import styled from "styled-components";
import Navbar from "./Navbar";

const HeaderContainer = styled.div`
  background-image: url(https://images.unsplash.com/photo-1429892494097-cccc61109f58?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1950&q=80);
  position: static;
  min-width: 100%;
  min-height: 100%;
  background-size: cover;
  background-position: center;
`;

const HeroImage = styled.img`
  height: 16em;
  width: 16em;
  object-fit: contain;
  border-radius: 50%;
`;

const HeroContainer = styled.div`
  padding: 6em 0 1em 0;
  display: flex;

  justify-content: center;
`;

const HeadingContainer = styled.div`
  margin: 5em;
`;

const Header = () => {
  return (
    <>
      <Navbar />
      <HeaderContainer>
        <HeroContainer>
          <HeroImage src="/profile-photo.jpg" alt="profile-photo" />
          <HeadingContainer>
            <h1>hal fulcher</h1>
            <h2>WEB DEVELOPER</h2>
          </HeadingContainer>
        </HeroContainer>
      </HeaderContainer>
    </>
  );
};

export default Header;
